//242. Valid Anagram - E. Given two strings s and t , write a function to determine if t is an anagram of s.

#include <iostream>
#include <vector>
#include <string>
using namespace std;

void print(vector<int>& nums1 ) {
    for (int e : nums1){
        cout << e << " ";
    }
    cout << "\n";
}

bool isAnagram(string s, string t) {
    unsigned long si = s.size();
    if (si != t.size()) return false;
    vector<int> count_s (27, 0);
    const int diff = 'a';
    for (unsigned long i = 0; i < si; i++){
        count_s[int(s[i]) - diff]++;
        count_s[int(t[i]) - diff]--;
    }
    for (unsigned long i = 0; i < 27; i++){
        if (count_s[i] != 0) return false;
    }
    return true;
}

int main() {
    cout << isAnagram("anagram", "nagaram") << endl;
    cout << isAnagram("rat", "car") << endl;
    string s = "";
    string t = "";
    cout << isAnagram(s, t) << endl;

    return 0;
}
